import BookmarkIcon from "../icons/BookmarkFilledIcon";

const BookmarkedModuleCard: React.FC = () => {
    const dummyModuleCodes: string[] = [
        "CS1101s", "CS2030", "CS2040", "CS1231", "CS3219"
    ];

    const renderModuleCodes = () => dummyModuleCodes.map(moduleCode => {
        return (
            <div style={styles.moduleCode}>
                {moduleCode}
            </div>
        );
    });

    return (
        <div style={styles.container}>
            <div style={styles.header}>
                <div>
                    <BookmarkIcon />
                </div>
                <div>
                    Bookmarked Modules
                </div>
            </div>
            <div style={styles.moduleList}>
                {renderModuleCodes()}
            </div>
        </div>

    );
};

const styles = {
    moduleCode: {
        padding: 10,
        backgroundColor: "#7497CC",
        color: "#fff",
        borderRadius: 15,
        boxShadow: "0px 8px 8px rgba(0, 0, 0, 0.25)",
    },
    moduleList : {
        display:"flex",
        flexDirection:"row",
        justifyContent: "space-between"
    },
    container: {
        padding: 30,
        backgroundColor: "#7497CC",
        color: "#fff",
        borderRadius: 15,
        boxShadow: "0px 8px 8px rgba(0, 0, 0, 0.25)",
        marginBottom: 15
      },
    header: {
        display: "flex",
        justifyContent: "flex-start"
    },
};

export default BookmarkedModuleCard;
